description:
The Gatekeepers

Sociopolitical Documentary hosted by Dror Moreh, published by Cinephil in 2012 - English narration


Information
------------------------------

Charged with overseeing Israel's war on both Palestinian and Jewish terrorism, the Shin Bet, Israel's secret service is present at the crossroad of every decision made. For the first time ever six former heads of the agency agreed to share their insights and reflect publicly on their actions and decisions. The Gatekeepers offers an exclusive account of the sum of their success and failures. It validates the reasons that each man individually and the six as a group came to reconsider their hard-line positions and advocate a conciliatory approach toward their enemies based on a two-state solution.

